import React from 'react';

const vitamins = (props) => {
  return(
  <div>
      <h1> hello </h1>
      <form>
        <input  type="text" id="value" max="100" onChange={props.getInputValue}/>
        <br></br>
        <label for="VitaminA" />VitaminA
        Vitamin A <progress  name="VitaminA" id="myProgress" value="0" max="2000" />
        <button onClick={props.submitBtn}>AddValue</button>
      </form>
    </div>
  )
}

export default vitamins;
